window.bookSummaryJSON = "<p><b><i>New York Times</i></b><b>and </b><b><i>USA Today</i></b><b>bestselling author Nicholas Sansbury Smith pulls the surviving divers into another heart-stopping adventure in </b><b><i>Hell Divers XI: Renegades</i></b><b>.</b></p> <p>The secret location of the Vanguard Islands is no longer a secret …</p> <p>Tired from years of fighting, Xavier passes the crown to a younger Hell Diver, Kade Long, and then sets off on the <i>Sea Wolf</i> with Magnolia to find Michael and his family. But the journey will push them both to their limit.</p> <p>On the damaged airship <i>Vanguard</i>, Michael and crew are running out of water and must dive to a new location before attempting the perilous voyage across the Atlantic to a new home.</p> <p>Back at the Vanguard Islands, King Kade hurries to prepare the rigs’ defenses against the Forerunner and his Knights of the Coral Castle. Fearing that X won’t return with the airship in time, Kade sends the elite Barracudas on a mission to find aircraft that will give the islands a fighting chance against the knights.</p> <p>In the penultimate Hell Divers book, the survivors travel skewed and far-flung paths, but soon those paths will converge. The journey is almost over, so strap in for the last dives!</p>"; 
